/* START CODE */

/****** DEFINITION OF LIBRARIES *****/
#include <forcedBMX280.h>	//https://github.com/soylentOrange/Forced-BMX280

/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);

/****** DEFINITION OF LIBRARIES CLASS INSTANCES*****/
// Instantiate the ForcedBMX280 object
ForcedBMX280 sensor; // Default I2C address will be used

void setup(void)
{
	// Initialize the sensor
	if (sensor.begin() != ERROR_OK) {
		Serial.println("Sensor initialization failed!");
		while (1); // Stop the program
	}

	// Set up serial communication for debugging
	Serial.begin(9600);
}

void loop(void)
{
	// Read temperature and humidity
	int32_t temperature = sensor.getTemperatureCelsius(true);
	uint32_t humidity = sensor.getRelativeHumidity(true);

	// Display the readings
	Serial.print("Temperature: ");
	Serial.print(temperature);
	Serial.println(" ¬∞C");

	Serial.print("Humidity: ");
	Serial.print(humidity);
	Serial.println(" %");

	// Add a delay for readability
	delay(2000);
}

/* END CODE */

module full_flagram (
    output wire [15:0] o_w_out,
    input wire i_w_clk,
    input wire [3:0] i_w_address,
    input wire [3:0] i_w_data,
    input wire i_w_we,
    input wire i_w_oe,
    input wire i_w_flags_out
);
    // FLAGS
    wire [15:0] l_w_flags;

    // RAM read data
    wire [3:0] l_w_ram_data;

    // RAM
    sol_ram #(
        .p_data_width(4),
        .p_address_width(4)
    ) ram_inst (
        .o_w_out(l_w_ram_data),
        .i_w_in(i_w_data),
        .i_w_address(i_w_address),
        .i_w_we(i_w_we),
        .i_w_oe(i_w_oe),
        .i_w_clk(i_w_clk)
    );

    // Flags
    wire Z_flag;
    wire S_flag;
    wire E_flag;
    wire O_flag;
    wire C2_flag;
    wire S2_flag;
    wire G4_flag;
    wire L4_flag;
    wire POW_flag;
    wire SMAX_flag;
    wire SMIN_flag;
    wire MAX_flag;
    wire PAL_flag;
    wire SB2_flag;

    assign Z_flag = (|l_w_ram_data);
    assign S_flag = l_w_ram_data[3];
    assign E_flag = (~(^l_w_ram_data));
    assign O_flag = (^l_w_ram_data);
    assign C2_flag = !l_w_ram_data[2];
    assign S2_flag = l_w_ram_data[2];
    assign G4_flag = l_w_ram_data > 4'd4;
    assign L4_flag = l_w_ram_data < 4'd4;
    assign POW_flag = (l_w_ram_data == 4'd1) || (l_w_ram_data == 4'd2) || (l_w_ram_data == 4'd4) || (l_w_ram_data == 4'd8);
    assign SMAX_flag = l_w_ram_data == 4'd7;
    assign SMIN_flag = l_w_ram_data == 4'd8;
    assign MAX_flag = l_w_ram_data == 4'd15;
    assign PAL_flag = (l_w_ram_data[0] == l_w_ram_data[3]) && (l_w_ram_data[1] == l_w_ram_data[2]);
    assign SB2_flag = (l_w_ram_data[3] == l_w_ram_data[2]) || (l_w_ram_data[2] == l_w_ram_data[1]) || (l_w_ram_data[1] == l_w_ram_data[0]);

    wire [15:0] l_w_flags_in;
    wire [15:0] l_w_flags_out;
    assign l_w_flags_in = {2'd0, SB2_flag, PAL_flag, MAX_flag, SMIN_flag, SMAX_flag, POW_flag, L4_flag, G4_flag, S2_flag, C2_flag, O_flag, E_flag, S_flag, Z_flag};

    // register for FLGAS
    sol_register #(
        .p_data_width(16)
    ) register_inst (
        .o_w_out(l_w_flags_out),
        .i_w_in(l_w_flags_in),
        .i_w_we(i_w_oe),
        .i_w_oe(i_w_flags_out),
        .i_w_clk(i_w_clk),
        .i_w_reset(1'b1)
    );

    assign o_w_out = i_w_we ? 16'd0 : (i_w_oe ? {12'd0, l_w_ram_data} : (i_w_flags_out ? l_w_flags_out : 16'd0));

endmodule






module sol_flagram (
    output wire [3:0] o_w_out,
    input wire i_w_clk,
    input wire [3:0] i_w_address,
    input wire [3:0] i_w_data,
    input wire i_w_we,
    input wire i_w_oe,
    input wire i_w_flags_out
);

    wire [15:0] l_w_full_out;

    full_flagram full_flagram_inst (
        .o_w_out(l_w_full_out),
        .i_w_clk(i_w_clk),
        .i_w_address(i_w_address),
        .i_w_data(i_w_data),
        .i_w_we(i_w_we),
        .i_w_oe(i_w_oe),
        .i_w_flags_out(i_w_flags_out)
    );

    assign o_w_out = (i_w_we || i_w_oe) ? l_w_full_out[3:0] : (
        i_w_flags_out ? {l_w_full_out[4'd`OP3], l_w_full_out[4'd`OP2], l_w_full_out[4'd`OP1], l_w_full_out[4'd`OP0]} : 4'd0
    );
endmodule

module fsm_sequence (
    input wire [1:0] i_w_in,    // Intrare pe 2 bi»õi: 2'd0 -> 'a', 2'd1 -> 'b', 2'd2 -> 'c', 2'd3 -> 'd'
    input wire i_w_clk,         // Semnal de ceas
    input wire i_w_reset,       // Reset activ 0
    output reg o_w_out          // Ie»ôire: 1 dacƒÉ secven»õa este validƒÉ, 0 altfel
);

    // Definirea stƒÉrilor folosind localparam
    localparam IDLE = 3'b000;  // Stare ini»õialƒÉ
    localparam S1   = 3'b001;  // Stare dupƒÉ detectarea lui 'a'
    localparam S2   = 3'b010;  // Stare dupƒÉ detectarea lui 'b'
    localparam S3   = 3'b011;  // Stare dupƒÉ detectarea lui 'c'

    // Registre pentru starea curentƒÉ »ôi starea urmƒÉtoare
    reg [2:0] current_state, next_state;

    // Tranzi»õiile FSM
    always @(posedge i_w_clk or negedge i_w_reset) begin
        if (!i_w_reset) 
            current_state <= IDLE; // Reset la stare ini»õialƒÉ
        else
            current_state <= next_state;
    end

    // Logica pentru determinarea stƒÉrii urmƒÉtoare
    always @(*) begin
        next_state = current_state; // Implicit rƒÉm√¢ne √Æn starea curentƒÉ
        case (current_state)
            IDLE: 
                if (i_w_in == 2'd0) // DetecteazƒÉ 'a'
                    next_state = S1;
            S1: 
                if (i_w_in == 2'd1) // DetecteazƒÉ 'b'
                    next_state = S2;
                else 
                    next_state = IDLE;
            S2: 
                if (i_w_in == 2'd2) // DetecteazƒÉ 'c'
                    next_state = S3;
                else 
                    next_state = IDLE;
            S3: 
                if (i_w_in == 2'd1) // DetecteazƒÉ din nou 'b' pentru repeti»õie
                    next_state = S2;
                else if (i_w_in == 2'd0) // Permite detectarea unui nou 'a'
                    next_state = S1;
                else
                    next_state = IDLE;
        endcase
    end

    // Logica pentru ie»ôirea FSM
    always @(*) begin
        o_w_out = (current_state == S3); // Secven»õa este validƒÉ √Æn starea S3
    end

endmodule

#include <iostream>
#include <vector>
#include <queue>
#include <utility>


using namespace std;
using vvi = vector<vector<int>>;

const int INF = 1e9;
template <class T>
class Heap
{
private:
    T* arr;
    int size;
    int maxSize;

    void FilterDown(int cur)
    {
        int curChild = 2 * cur + 1;

        while (cur < size)
        {
            curChild = ((curChild + 1 < size) && arr[curChild] < arr[curChild + 1]) ? curChild + 1 : curChild;
            if (arr[curChild] <= arr[cur]) break;

            swap(arr[cur], arr[curChild]);
            cur = curChild;
            curChild = 2 * cur + 1;

        }
    }

    void FilterUp(int cur)
    {
        int parent = (cur - 1) / 2;

        while (cur && arr[cur] >= arr[parent])
        {
            swap(arr[cur], arr[parent]);
            cur = parent;
            parent = (cur - 1) / 2;
        }
    }

    void HeapBuild()
    {
        int cur = (size - 2) / 2;

        while (cur >= 0)
        {
            FilterDown(cur);
            cur--;
        }

    }

public:

    Heap(int _maxSize = 256)
    {
        maxSize = _maxSize;
        size = 0;
        arr = new T[maxSize];

        if (arr == 0) throw "MemoryAllocError";
    }

    Heap(int _size, int _maxSize = 256)
    {
        size = _size;
        maxSize = _maxSize;
        arr = new T[maxSize];

        if (arr == 0) throw "MemoryAllocError";
    }

    Heap(T* _arr, int _size, int _maxSize = 256)
    {
        if (_arr == nullptr) throw "Nullptr";

        size = _size;
        maxSize = _maxSize;
        arr = new T[maxSize];

        if (arr == 0) throw "MemoryAllocError";

        for (int i = 0; i < size; ++i)
            Heap<T>::arr[i] = _arr[i];

        HeapBuild();


    }

    Heap(const Heap<T>& H)
    {
        if (H.arr == nullptr) throw "Nullptr";

        size = H.size;
        maxSize = H.maxSize;
        arr = new T[maxSize];

        if (arr == 0) throw "MemoryAllocError";

        for (int i = 0; i < size; ++i)
            this->arr[i] = H.arr[i];


        HeapBuild();
    }

    void push(const T& key)
    {

        if (!size)
        {
            arr = new T[maxSize];
            if (arr == 0) throw "MemoryAllocError";
        }

        if (size == maxSize)
        {
            T* arrBuff = arr;
            arr = new T[maxSize * 2];

            if (arr == 0) throw "MemoryAllocError";

            for (int i = 0; i < size; ++i)
                arr[i] = arrBuff[i];

            delete[] arrBuff;
        }

        size++;
        arr[size - 1] = key;
        FilterUp(size - 1);
    }

    void pop()
    {
        arr[0] = arr[size - 1];
        size--;

        FilterDown(0);
    }

    T top() const
    {
        return arr[0];
    }

    bool empty() const
    {
        return (size == 0);
    }

    void print() const
    {
        for (int i = 0; i < size; ++i)
            cout << arr[i] << " ";
        cout << '\n';
    }

    ~Heap()
    {
        delete[] arr;
    }
};

vector<int> dijkstra_with_vector(vvi graph, int start)
{
	int n = graph.size();
	vector<int> dist(n, INF);
	vector<bool> visited(n, 0);
	vector<int> q = { start };

	dist[start] = 0;

	while (!q.empty())
	{
		int u = q.back();
		q.pop_back();

        if (visited[u]) continue;
        visited[u] = 1;

		for (int i = 0; i < graph[u].size(); ++i)
		{
			if (graph[u][i] != 0 && (dist[i] == INF || dist[i] > dist[u] + graph[u][i]))
			{
				dist[i] = dist[u] + graph[u][i];
				q.push_back(i);
			}
		}
	}

	return dist;
}

vector<int> dijkstra_with_queue(vvi graph, int start)
{
    priority_queue<pair<int, int>, vector<pair<int, int>>, greater<pair<int, int>>> q;
	vector<int> dist(graph.size(), INF);
	vector<bool> visited(graph.size(), 0);

	q.push({0, start});
	dist[start] = 0;


	while (!q.empty())
	{
        int u = q.top().second;
        int dist_u = q.top().first;
		q.pop();

        if (visited[u]) continue;
        visited[u] = 1;

		for (int i = 0; i < graph[u].size(); ++i)
		{
			if (graph[u][i] != 0 && dist[i] > dist_u + graph[u][i])
			{
				dist[i] = dist_u + graph[u][i];
                q.push({ dist[i], i });
			}
		}
	}
    return dist;
}

vector<int> dijkstra_with_heap(vvi graph, int start)
{
    Heap<pair<int,int>> heap;
    vector<int> dist(graph.size(), INF);
    vector<bool> visited(graph.size(), 0);

    dist[start] = 0;
    heap.push({0, start});

    while (!heap.empty())
    {
        int u = heap.top().second;
        int dist_u = heap.top().first;
        heap.pop();

        if (visited[u]) continue;
        visited[u] = 1;

        for (int i = 0; i < graph[u].size(); ++i)
        {
            if (graph[u][i] != 0 &&  dist[i] > dist_u + graph[u][i])
            {
                dist[i] = dist_u + graph[u][i];
                heap.push({ dist[i], i });

            }
        }

    }

    return dist;
}

int main()
{
    int n;
    cin >> n;

    int s, k;
    cin >> s >> k;
    s--; k--;

    vector<vector<int>> graph(n, vector<int>(n, 0));

    for (int i = 0; i < n; ++i)
        for (int j = 0; j < n; ++j)
            cin >> graph[i][j];


    vector<int> dist = dijkstra_with_vector(graph, s);
    vector<int> dist2 = dijkstra_with_queue(graph, s);
    vector<int> dist3 = dijkstra_with_heap(graph, s);

    cout << dist[k] << ' ' << dist2[k] << ' ' << dist3[k];

	return 0;
}
